import React, { useState } from "react";
import Content from "../../components/Content";
import ExpedienteServices from "../../services/ExpedienteServices";

// Librerias GRID
import Grid from "@mui/material/Grid";

// LIBRERIAS FORMULARIOS
import {
  FormControl,
  InputLabel,
  TextField,
  MenuItem,
  Select,
  Button,
} from "@mui/material";


const ExpedientesAdd = () => {
  const [paciente, setPaciente] = useState("");
  const [familiograma, setFamiliograma] = useState("");
  const [antecedentes, setAntecedentes] = useState("");
  const [padecimientos, setPadecimientos] = useState("");
  const [tratamientos, setTratamientos] = useState("");
  const [diagnostico, setDiagnostico] = useState("");

  const handlePaciente = (event) => {
    setPaciente(event.target.value);
  };
  const handleFamiliograma = (event) => {
    setFamiliograma(event.target.value);
  };
  const handleAntecedentes = (event) => {
    setAntecedentes(event.target.value);
  };
  const handlePadecimientos = (event) => {
    setPadecimientos(event.target.value);
  };
  const handleTratamientos = (event) => {
    setTratamientos(event.target.value);
  };
  const handleDiagnostico = (event) => {
    setDiagnostico(event.target.value);
  };

  const handleSubmit = (event) => {
    const expediente = {
      paciente: paciente,
      familiograma: familiograma,
      antecedentes: antecedentes,
      padecimientos: padecimientos,
      tratamientos: tratamientos,
      diagnostico: diagnostico,
    };
    console.log(expediente);
    ExpedienteServices.createExpediente(expediente);
  };

  return (
    <Content>
      <form>
        <h1> EXPEDIENTE </h1>
        <Grid container spacing={2}>
          <Grid item xs={1}></Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
            <InputLabel id="paciente">Paciente</InputLabel>
              <Select
                labelId="paciente"
                id="paciente"
                name="paciente"
                onChange={handlePaciente}
              >
                <MenuItem key="1" value="juan">
                  Juan Hernandez
                </MenuItem>
                <MenuItem key="2" value="patricia">
                  Patricia Olivares
                </MenuItem>
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={1}></Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
              <TextField
                fullWidth
                label="familiograma"
                id="familiograma"
                onChange={handleFamiliograma}
              />
            </FormControl>
          </Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
              <TextField
                fullWidth
                label="antecedentes"
                id="antecedentes"
                onChange={handleAntecedentes}
              />
            </FormControl>
          </Grid>
          <Grid item xs={1}></Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
              <TextField
                fullWidth
                label="padecimientos"
                id="padecimientos"
                onChange={handlePadecimientos}
              />
            </FormControl>
          </Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
              <TextField
                fullWidth
                label="tratamientos"
                id="tratamientos"
                onChange={handleTratamientos}
              />
            </FormControl>
          </Grid>
          <Grid item xs={1}></Grid>
          <Grid item xs={4}>
            <FormControl fullWidth>
              <TextField
                fullWidth
                label="diagnostico"
                id="diagnostico"
                onChange={handleDiagnostico}
              />
            </FormControl>
          </Grid>
          <Grid item xs={3}></Grid>
          <Grid item xs={5}></Grid>
          <Grid item xs={2}>
            <Button
              variant="contained"
              color="success"
              type="submit"
              onClick={handleSubmit}
            >
              Registrar
            </Button>
          </Grid>
          <Grid item xs={2}>
            <a href="/psicologos"> Cancelar </a>
          </Grid>
          <Grid item xs={5}></Grid>
        </Grid>
      </form>
    </Content>
  );
};

export default ExpedientesAdd;
